import React, { useState } from "react";
import Axios from "axios";
import moment from "moment";

function ShortUrl() {
  var a = moment();
  var b = moment("2021-03-05");
  let datediff = a.diff(b);

  return (
    <div className="cotainer">
      <div className="h1">{datediff}</div>
    </div>
  );
}

export default ShortUrl;
